    false,nt"url": null,nt"notes": "This narrative report for Clarence Cannon
    NWR outlines Refuge accomplishments during the 1976 calendar year, including the
    Annada District. The report begins with an introduction to the Refuge and information
    about weather conditions, habitat conditions, land acquisition activities, and the
    system status. Construction and maintenance are also described. Habitat management
    is covered; croplands, grasslands, and wetlands are discussed. The wildlife section
    of the report discusses migratory birds and mammals. Interpretation and recreation
    activities are outlined; topics include information and interpretation, recreation,
    and law enforcement. Cooperative programs, items of interest, and safety information
    are attached. A memo that describes Refuge events between July and December, 1975
    is also included.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
